import React from 'react';
import Dashboard from './components/Dashboard';

const App = () => {
  return (
    <div className="min-h-screen bg-gray-100">
      <div className="p-6">
        <h1 className="text-2xl font-bold mb-4">HealthHub</h1>
        <Dashboard />
      </div>
    </div>
  );
};

export default App;
